import React from 'react';
import './CardComponent.css';
import myimg from '../assets/card.png';

const CardComponent = () => {
  return (
    <div className="container-fluid">
        <h4>Card Creation Using Bootstrap</h4>
        {/* card */}
        <div className="row">
          <div className="col-md-6 col-lg-4">
            <div className="card">
              <div className="card-content">
                <img src={myimg} alt="Card Image" className="card-image"/>
              </div>
            </div>
          </div>
          <div className="col-md-6 col-lg-4">
            <div className="card">
              <div className="card-content">
                <h2 className="card-title">Visit Card</h2>
                  <p className="card-description">
                  A visiting card is a small card that is typically used to introduce oneself in social settings.
                  </p>
                  <button className="btn btn-primary">Get It</button>
              </div>
            </div>
          </div>
        </div>
    </div>
  );
};

export default CardComponent;
